function ExitFederatedAppComponent(backendId, federatedAppId, federatedAccountGuid) {
  this.backendId = backendId;
  this.federatedAppId = federatedAppId;
  this.federatedAccountGuid = federatedAccountGuid;
}

ExitFederatedAppComponent.prototype.getBackendId = function () {
  return this.backendId;
}

ExitFederatedAppComponent.prototype.getExitComponentAsStr = function () {
  return 'Ex' + this.federatedAccountGuid + ':' + this.federatedAppId;
}

module.exports.ExitFederatedAppComponent = ExitFederatedAppComponent;